import React from 'react';
import {Card} from "react-bootstrap"

export default function ProductCard() {
    return (
        <Card style={{ width: '18rem', margin: "15px", display: "flex" }}>
        <Card.Img variant="top" src="https://www.tiendafuencarral.com.ar/46200-large_default/air-max-200-gs-az-ng-ct.jpg" />
        <Card.Body>
          <Card.Title>Card Title</Card.Title>
          <Card.Text>
            Some quick example text to build on the card title and make up the bulk of
            the card's content.
          </Card.Text>
        </Card.Body>
      </Card>
    )
}
